import Vue from 'vue'
import VueRouter from 'vue-router'

Vue.use(VueRouter)

const routes = [
  {
    path: '/',
    redirect: ''
  },
  {
    name: 'home',
    path: '/home',
    component: () => import('../views/home/home-page.vue')
  },
  {
    name: 'login',
    path: '/login',
    component: () => import('../views/login/index-page.vue')
  }
]

const router = new VueRouter({
  routes
})

export default router
